import React, { Component, Fragment } from 'react';
import { BrowserRouter, Route } from "react-router-dom";

import Layout from './components/Layout/Layout';
import Home from './components/Pages/Home';
import Feature from './components/Pages/Feature';
import Watch from './components/Pages/Watch';
import Listen from './components/Pages/Listen';
import Price from './components/Pages/Price';

import Header from './components/Partials/Header';
import Footer from './components/Partials/Footer';
import BackButton from './components/Partials/BackButton';

class App extends Component {
	render() {
		return (
			<Layout>
				<BrowserRouter>
					<Route exact path="/" render={props =>
						<Fragment>
							<Home />
						</Fragment>
					} />
					<Route path="/feature" render={props =>
						<Fragment>
							<Header status="white" />
							<BackButton status="white" />
							<Feature />
							<Footer status="white" />
						</Fragment>
					} />
					<Route path="/watch" render={props =>
						<Fragment>
							<Header status="black" />
							<BackButton status="black" />
							<Watch />
							<Footer status="black" />
						</Fragment>
					} />
					<Route path="/listen" render={props =>
						<Fragment>
							<Header status="white" />
							<BackButton status="white" />
							<Listen />
							<Footer status="white" />
						</Fragment>
					} />
					<Route path="/price" render={props =>
						<Fragment>
							<Header status="white" />
							<BackButton status="white" />
							<Price />
							<Footer status="white" />
						</Fragment>
					} />
				</BrowserRouter>
			</Layout>
		);
	}
}

export default App;
